public class InnerGatewayRouteGatewayRouteSpecFactory(Action<Humidifier.AppMesh.GatewayRouteTypes.GatewayRouteSpec> factoryAction = null) : SubResourceFactory<Humidifier.AppMesh.GatewayRouteTypes.GatewayRouteSpec>
{

    internal InnerGatewayRouteHttpGatewayRouteFactory HttpRouteFactory { get; set; }

    internal InnerGatewayRouteHttpGatewayRouteFactory Http2RouteFactory { get; set; }

    internal InnerGatewayRouteGrpcGatewayRouteFactory GrpcRouteFactory { get; set; }

    protected override Humidifier.AppMesh.GatewayRouteTypes.GatewayRouteSpec Create()
    {
        var gatewayRouteSpecResult = CreateGatewayRouteSpec();
        factoryAction?.Invoke(gatewayRouteSpecResult);

        return gatewayRouteSpecResult;
    }

    private Humidifier.AppMesh.GatewayRouteTypes.GatewayRouteSpec CreateGatewayRouteSpec()
    {
        var gatewayRouteSpecResult = new Humidifier.AppMesh.GatewayRouteTypes.GatewayRouteSpec();

        return gatewayRouteSpecResult;
    }
    public override void CreateChildren(Humidifier.AppMesh.GatewayRouteTypes.GatewayRouteSpec result)
    {
        base.CreateChildren(result);

        result.HttpRoute ??= HttpRouteFactory?.Build();
        result.Http2Route ??= Http2RouteFactory?.Build();
        result.GrpcRoute ??= GrpcRouteFactory?.Build();
    }

} // End Of Class

